reqwest = "0.11.10"
serde = { version = "1.0.125", features = ["derive"] }
clipboard = "0.5.0"
rodio = "0.13.0"
```
3. Run the application using `cargo run`.
4. The application will read the contents of the clipboard aloud using the ElevenLabs API and TTS.

